Per il nostro calendario dell'avvento culinario, @lellopanello ci presenta un risotto meraviglioso, caldo e avvolgente che, proprio come il Natale, unisce le persone. Siamo a Gavi, in Piemonte, terra che Lello conosce molto bene, dato che nelle sue vene scorre sangue piemontese. Siete pronti per ricominciare da capo il pranzo di Natale?
Guardate il video integrale sul nostro canale YouTube.
-

