Vi stavate chiedendo come trascorrono il Natale gli Chef in Camicia? Beh si sa, a Natale si sta in famiglia e noi che siamo una grande famiglia abbiamo deciso di riunirci tutti in questo giorno di festa per un bell'aperitivo di gruppo. Ai fornelli c'è @cuoconav1 , il maestro non poteva di certo abbandonare i suoi, al bancone del bar ci sono @lellopanello e @nick_zmb , che preparano il loro drink preferito, ovviamente @aperolspritzitalia . Sembra essere tutto pronto, andiamo a festeggiare! Buon Natale a tutti voi!
-

