Carciofini sott’olio, 6;
Succo di 1⁄2 limone;
Prezzemolo tritato/ Erba cipollina;
Burro, 10 g;
Mandorle, 40 g;
Peperoncino in polvere, 1 pizzico;
Zucchero di canna, 2 cucchiai;. Per il patè Rosa:
Mortadella, 150 g;
Ricotta vaccina, 80 g;
Grana padano grattugiato, 10 g;
Sale/Pepe/Pistacchi.

